$(document).ready(function () {

    // Toggle für dritte Navigationsebene
    $(".dropdown-menu a.dropdown-toggle").on("click", function (o) {
        var s = $(this);
        s.toggleClass("active-dropdown");
        var n = $(this).offsetParent(".dropdown-menu");
        $(this).next().hasClass("show") || $(this).parents(".dropdown-menu").first().find(".show").removeClass("show");
        var e = $(this).next(".dropdown-menu");
        return e.toggleClass("show"), $(this).parent("li").toggleClass("show"), $(this).parents("li.nav-item.dropdown.show").on("hidden.bs.dropdown", function (o) {
            $(".dropdown-menu .show").removeClass("show"), s.removeClass("active-dropdown")
        }), n.parent().hasClass("navbar-nav") || s.next().css({top: s[0].offsetTop, left: n.outerWidth() - 4}), !1
    });

    // MegaMenu in Fullscreen ohne Page-Scrollbar
    $(".wiro-navMegamenu-toggler, .wiro-searchLayer, .wiro-closeButton").on("click", function() {
        setTimeout(function(){
            if($(".wiro-navMegamenu-overlay").hasClass('show') || $(".wiro-searchLayer-overlay").hasClass('show')) {
                $('body').addClass('no-scroll');
            }
            if(!$(".wiro-navMegamenu-overlay").hasClass('show') && !$(".wiro-searchLayer-overlay").hasClass('show')) {
                $('body').removeClass('no-scroll');
            }
        }, 500);
    });

    // Show only one overlay
    $(".wiro-navMegamenu-toggler").on("click", function() {
        if($(".wiro-searchLayer-overlay").hasClass('show')) {
            $(".wiro-searchLayer").click();
        }
        if($(".wiro-appsMegamenu-overlay").hasClass('show')) {
            $(".wiro-appsMegamenu-toggler").click();
        }
    });

    $(".wiro-appsMegamenu-toggler").on("click", function() {
        if($(".wiro-searchLayer-overlay").hasClass('show')) {
            $(".wiro-searchLayer").click();
        }
        if($(".wiro-navMegamenu-overlay").hasClass('show')) {
            $(".wiro-navMegamenu-toggler").click();
        }
    });

    $(".wiro-searchLayer").on("click", function() {
        if($(".wiro-navMegamenu-overlay").hasClass('show')) {
            $(".wiro-navMegamenu-toggler").click();
        }
        if($(".wiro-appsMegamenu-overlay").hasClass('show')) {
            $(".wiro-appsMegamenu-toggler").click();
        }
    });

});


function megaMenuDropDownToggle(mediaQuery) {
    if (mediaQuery.matches) {
        $('.wiro-navMegamenu-overlay .dropdown-toggle').dropdown('dispose').removeAttr('data-toggle')
    } else {
        $('.wiro-navMegamenu-overlay .dropdown-toggle').dropdown().attr('data-toggle','dropdown');
    }
}

// Create a MediaQueryList object
var mediaQueryBoostrapLg = window.matchMedia("(min-width: 1200px)")

// Call listener function at run time
megaMenuDropDownToggle(mediaQueryBoostrapLg);

// Attach listener function on state changes
mediaQueryBoostrapLg.addEventListener("change", function() {
    megaMenuDropDownToggle(mediaQueryBoostrapLg);
});


