//# sourceMappingURL=awesomplete.min.js.map

// Global datepicker settings
var datepickerSettings = {
    language: "de",
    autoclose: true
};

// Global ajax load function
function ajaxContent(container,url){
    $.ajax({
        url: url,
        dataType: 'text',
        success: function (data) {
            container.replaceWith($(data).find('#solrContent'));

            window.history.pushState('obj', 'newtitle', url);

            $('.selectpicker').selectpicker();
            $('.solr-range-facet-field').datepicker(datepickerSettings);
        }
    });
}

$(document).ready(function() {

    // Range facet
    var fromRange = '';
    var toRange = '';

    $('.solr-range-facet-field').datepicker(datepickerSettings);

    $(document).on('change','.solr-range-facet-field',function(){

        var solrContainer = $('#solrContent');
        var createdUrl = $('#dateRangeUrl').val();
        var timeSplitted = $(this).val().split('.');
        var timeFormattedForSolr = timeSplitted[2]+timeSplitted[1]+timeSplitted[0]+'0000';

        if ($(this).attr('id') == 'gi-date-from') {
            fromRange = timeFormattedForSolr;
        } else if ($(this).attr('id') == 'gi-date-to') {
            toRange = timeFormattedForSolr;
        }

        if (fromRange != '' && toRange != '') {
            solrContainer.fadeTo( "slow", 0.33 );
            createdUrl = createdUrl.replace('___FROM___',fromRange);
            createdUrl = createdUrl.replace('___TO___',toRange);
            ajaxContent(solrContainer,createdUrl);
        }
    });

    // Ajax links
    $(document).on('click','.wiro-search-filter-box a.list-group-item, #solrContent .pagination a',function(){

        var solrContainer = $('#solrContent');
        solrContainer.fadeTo( "slow", 0.33 );
        var ajaxHref = $(this).attr('href');

        if ($(this).hasClass('bootstrap-select-option')) {
            ajaxHref = $(this).find('span.urlspan').attr('aria-href');
        }
        ajaxContent(solrContainer,ajaxHref);
        return false;
    });

    // Alle Inhalte anzeigen/ausblenden
    $(document).on('click','#search-include-microsites input',function(){

        var solrContainer = $('#solrContent');
        solrContainer.fadeTo( "slow", 0.33 );
        if(solrContainer.hasClass('withMicrosites')) {
            dataField = 'standard';
        } else {
            dataField = 'complete';
        }
        ajaxContent(solrContainer,$('#solrContent').data(dataField));
    });

    // Suchfeld in Variable
    var searchField = $('.wirosearch-search-field');

    // Wen kein Suchfeld da ist, beenden
    if(searchField.length == 0) {
        return;
    }

    // Suchen-Icon im Layer
    $('.wiro-search-layer-submit').click(function (e) {   $(e.target).closest('form').submit(); });

    // lupe
    $('.wiro-search-layer-show').click(function (e) {
        $('.awesomplete h4').remove();
        $('.wiro-search-layer').show();
    });

    // X-Button
    $('.wiro-search-layer-close').click(function (e) {
        $('.awesomplete h4').remove();
        var formDiv = $(e.target).closest('form').parent();
        formDiv.find('input').val('');
        formDiv.hide();
    });

    $.regExpEscape = function (s) {
        return s.replace(/[-\\^$*+?.()|[\]{}]/g, "\\$&");
    };

    $.create = function(tag, o) {
        var element = document.createElement(tag);

        for (var i in o) {
            var val = o[i];

            if (i === "inside") {
                $(val).appendChild(element);
            }
            else if (i === "around") {
                var ref = $(val);
                ref.parentNode.insertBefore(element, ref);
                element.appendChild(ref);
            }
            else if (i in element) {
                element[i] = val;
            }
            else {
                element.setAttribute(i, val);
            }
        }

        return element;
    };

    $(searchField).each( function(i,element){

        var pageUid = ($('body').attr('id').replace('p', ''));

        // Awesomplete einrichten
        var searchSuggest = new Awesomplete(element, {
            list: [],
            filter: function (text, input) {
                return Awesomplete.FILTER_CONTAINS(text, input.match(/[^,]*$/)[0]);
            },
            item:  function (text, input) {

                var html = input.trim() === "" ? text : text.replace(RegExp($.regExpEscape(input.trim()), "gi"), "<mark>$&</mark>") ;
                if( this.list_count ) {
                    html = html + '&nbsp;<span>(' + this.list_count[text] + ')</span>';
                }
                return $.create("li", {
                    innerHTML: html,
                    "aria-selected": "false"
                });
            },
            replace: function (text) {
                this.input.value =  text;
            },
        });

        // Wenn ein Eintrag ausgewaehlt wird in der Liste
        $(element).on('awesomplete-selectcomplete', function(e) {  $(e.target).closest('form').submit(); });
        $(element).on('awesomplete-close', function(e) { $('.awesomplete h4').remove(); });
        $(element).on('awesomplete-open', function(e) {  $('.awesomplete h4').remove();   $('.wiro-search-layer .awesomplete ul').before(   $('.wiro-search-layer input.wirosearch-search-field').attr('data-label-default')   ) ; });

        // Wenn getippt wird
        $(element).keyup( function(e) {
            if(e.which <= 40) return; // Pfeiltasten nicht behindern
            if(this.value.length >= 3) {
                var output = [];
                var outputCount = [];
                $.ajax({
                    url: $('#tx-solr-search-form-pi-results').data('suggest'),
                    jsonp: 'tx_solr[callback]',
                    data: {
                        tx_solr: {
                            queryString: this.value.toLowerCase(),
                        },
                        type: 7384
                    },
                    dataType: 'jsonp',
                    success: function (data) {
                        $.each(data.suggestions, function(term, termIndex) {
                            output.push(term);
                            outputCount[term] = termIndex;
                        });
                        searchSuggest.list = output;
                        searchSuggest.list_count = outputCount;
                        searchSuggest.evaluate();
                    }
                });
            }
        });
    });
});